import React from 'react';

import TodoListItem from './todo-list-item';

const TodoList = ({ todos }) => {

    const elements = todos.forEach(item => {    
        console.log(item);
            return( 
                <li>
                    <TodoListItem 
                        label = {item.label}
                        important = {item.important} />
                </li>
                );
        });

    return (
        <ul>
            { elements }
        </ul>
    );
};

export default TodoList;
